import React from "react";
import Card from "./Card";
import contacts from "./contacts.js";

function App(){
    return 
    <Card 
        name= {contacts[0].name}
        image= {contacts[0].imgURL}
        tel={contacts[0].phone}
        email={contacts[0].email}
    />
    
}

export default App;
